import React from 'react';
import './Brandline.css'

const Brandline = () => {
    return (
        <div className="brand_line">
            <div className="block1">1</div>
            <div className="block2">1</div>
            <div className="block3">1</div>
            <div className="block4">1</div>
            <div className="block5">1</div>

        </div>
    );
};

export default Brandline;
